import axios from 'axios';

function MovieList() {
  
    useEffect(()=>{
      // Fetch movies with multiple actors
    axios
    .get(`${BASE_URL}/movies/multiple-actors`)
    .then((response) => setMovies(response.data))
    .catch((error) => setError(error.response.data));
    })
}

export default MovieList;
